import React from 'react';
import { useSelector } from 'react-redux';
import { Link } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';

function NavBar() {
  const navigate = useNavigate();
  const user = useSelector((state) => state.user);
  return (
    <div className="nav_wrapper">
      <div className="nav_left_wrapper">
        <div className="nav_logo">{/* <img src={sipit} alt="sipit" /> */}</div>
        <div className="nav_name"></div>
      </div>
      <div className="nav_right_wrapper">
        <div className="nav_link_wrapper">
          <div
            className="nav_link"
            onClick={() => {
              navigate('/');
            }}
          >
            <p className="p_nav">Главная</p>
          </div>
        </div>
        <div className="nav_link_wrapper">
          <div
            className="nav_link"
            onClick={() => {
              navigate('/products');
            }}
          >
            <Link to="/">
              <p className="p_nav">Продукты</p>
            </Link>
          </div>
        </div>
        <div className="nav_link_wrapper">
          <div className="nav_link">
            <Link to="/">
              <p className="p_nav">Контакты</p>
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
}

export default NavBar;
